import axios from "../utils/network"
import netUrl from "./networkPath"
import querystring from "querystring"





const api = {
    getVerificationCode() {
        return axios.get("http://103.233.253.29:8080/backend/getvarifacationcode")
    },
    async login(username, password, verificationCode, verificationCodeId) {
        console.log(username,password,verificationCode, verificationCodeId)
        const res = await axios.post(netUrl.baseUrl + netUrl.backend + netUrl.login, querystring.stringify({
            username: username,
            password: password,
            verificationCode: verificationCode,
            verificationCodeId: verificationCodeId
        }))
        console.log(res.data.msg)
        if (res.data.success) {
            this.$store.commit("setLoginStatus", true)
            this.$router.go(-1)
        } else {
            this.$store.commit("setErrMsg",res.data.msg)
        }

    }
}

export default api


